    body {
      overflow-x: hidden;
      overflow-y: hidden;
      margin: 0;
      padding: 0;
    }
  `}</style>
    </Head>
    <Header />
    {props.children}
    {/* <Footer /> */}
    <style jsx>{`
      .layout-container {
        height: 100%;
        background-color: rgb(10, 25, 47);
        #background-color: #d6c698;
        #background-color: cyan;
        margin: 0px;
        padding: 0px;
      }
    `}</style>
  </div>
);

